// ==UserScript==
// @name          탭 이동시 자동 음소거
// @namespace     탭 이동시 자동 음소거
// @match         *://*/*
// @version       0.3
// @description   Ctrl + Alt + M을 누르면 해당 탭의 자동 음소거 / 자동 음소거 비활성화를 토글합니다
// @icon          data:image/jpeg;base64,
// @author        mickey90427 <mickey90427@naver.com>
// @downloadURL https://update.greasyfork.org/scripts/462243/%ED%83%AD%20%EC%9D%B4%EB%8F%99%EC%8B%9C%20%EC%9E%90%EB%8F%99%20%EC%9D%8C%EC%86%8C%EA%B1%B0.user.js
// @updateURL https://update.greasyfork.org/scripts/462243/%ED%83%AD%20%EC%9D%B4%EB%8F%99%EC%8B%9C%20%EC%9E%90%EB%8F%99%20%EC%9D%8C%EC%86%8C%EA%B1%B0.meta.js
// ==/UserScript==

(function() {
  'use strict';

  var isTabMuted = true;
  var message = null;
  var audioElementsState = new Map();
  var videoElementsState = new Map();

  function muteTabsOnWindowBlur() {
    const audioElements = document.querySelectorAll('audio');
    audioElements.forEach(audio => {
      if (!audio.paused && document.visibilityState === 'hidden') {
        audioElementsState.set(audio, audio.currentTime); // 저장한 재생 시점을 맵에 저장
        audio.muted = isTabMuted;
      }
    });

    const videoElements = document.querySelectorAll('video');
    videoElements.forEach(video => {
      if (!video.paused && document.visibilityState === 'hidden') {
        videoElementsState.set(video, video.currentTime); // 저장한 재생 시점을 맵에 저장
        video.muted = isTabMuted;
      }
    });
  }

  function unmuteTabsOnWindowFocus() {
    const audioElements = document.querySelectorAll('audio');
    audioElements.forEach(audio => {
      if (audio.muted && document.visibilityState === 'visible') {
        audio.muted = false;
        if (audioElementsState.has(audio)) {
          audio.currentTime = audioElementsState.get(audio); // 이전 재생 시점으로 이동
          audioElementsState.delete(audio); // 저장한 재생 시점 삭제
        }
      }
    });

    const videoElements = document.querySelectorAll('video');
    videoElements.forEach(video => {
      if (video.muted && document.visibilityState === 'visible') {
        video.muted = false;
        if (videoElementsState.has(video)) {
          video.currentTime = videoElementsState.get(video); // 이전 재생 시점으로 이동
          videoElementsState.delete(video); // 저장한 재생 시점 삭제
        }
      }
    });
  }

  function init() {
    document.addEventListener('visibilitychange', function() {
      if (document.visibilityState === 'hidden') {
        muteTabsOnWindowBlur();
      } else {
        unmuteTabsOnWindowFocus();
      }
    });

    // 쿠키에서 값을 읽어와 초기 음소거 상태 설정
    var savedValue = readCookie("tabMuted");
    if (savedValue) {
      isTabMuted = (savedValue === "true");
    }

    // 단축키 토글 기능
    document.addEventListener('keydown', function(event) {
      if (event.ctrlKey && event.altKey && event.code === 'KeyM') {
        isTabMuted = !isTabMuted;

        // 쿠키에 값을 저장
        document.cookie = "tabMuted=" + isTabMuted + "; expires=Fri, 31 Dec 9999 23:59:59 GMT";

        if (message === null) {
          // 새로운 메시지 생성
          message = document.createElement('div');
          message.setAttribute('style', 'position: fixed; top: 50%; left: 50%; transform: translate(-50%, -50%); background-color: #2196f3; color: white; padding: 20px; border-radius: 10px; font-size: 24px; font-weight: bold; text-align: center; z-index: 9999;');
          document.body.appendChild(message);
        }
        // 메시지 업데이트
        message.textContent = isTabMuted ? '음소거' : '음소거 해제';
        setTimeout(function() {
          document.body.removeChild(message);
          message = null;
        }, 1000);

        // 음소거 모드 해제
        if (document.visibilityState === 'visible') {
          unmuteTabsOnWindowFocus();
        }
      }
    });
  }

  // 쿠키 읽기
  function readCookie(name) {
    var cookies = document.cookie.split("; ");
    for (var i = 0; i < cookies.length; i++) {
      var cookie = cookies[i].split("=");
      if (cookie[0] === name) {
        return cookie[1];
      }
    }
    return null;
  }

  init();
})();
